import React, {useEffect, useState} from "react";
import axios from 'axios';
import MenuBar from "../components/MenuBar";
import '../Test2.css'

function Test2() {
    const [jsondata, setJsondata] = useState([{}]);
    const [symptom_level, setSymptom_level] = useState(1);
    const [symptom, setSymptom] = useState('이+아픔');

    useEffect( () => {
        axios( {
            method: 'get',
            url: 'testapi?symptom_level=' + symptom_level + '&symptom=' + symptom,
        })
        .then(response => {
            console.log(response.data);
            setJsondata(response.data);
        })
    }, [symptom]);

    const onChangeSymptom_level = (e) => {
        setSymptom_level(e.target.value)
    }

    const onChangeSymptom = (e) => {
        setSymptom(e.target.value)
    }

    const AfterSubmit = (e) => {
        e.preventDefault();
        console.log('이거 출력: ' + e.target.value);
    }


    return (
        <div className="BackgroundDiv">
            <MenuBar />
            <form onSubmit={AfterSubmit} method="GET">
                    <div className="SearchSection">
                        <select name="symptom_level">
                            <option>증상 정도</option>
                            <option value="1">매우 아픔</option>
                            <option value="2">조금 아픔</option>
                            <option value="3">보통</option>
                            <option value="4">약한 증상</option>
                            <option value="5">의심 증상</option>
                        </select>
                        <select name="symptom" onChange={onChangeSymptom}>
                            <option>증상 선택</option>
                            <option>머리 아픔</option>
                            <option>눈 이상</option>
                            <option>뼈 부러짐</option>
                            <option>코 막힘</option>
                            <option>이 아픔</option>
                        </select>
                        <button type="submit">검색</button>
                    </div>
            </form>




            <div className="cardDiv">
                {jsondata.map((data, index) => (
                    <div className="card1">
                        <p key={index} className="Hname">{data.name}</p>
                        <p key={index} className="Haddr">{data.addr}</p>
                        <p key={index} className="Htelno">{data.telno}</p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Test2;
